import a1 from './image/img1.png';
import a2 from './image/img2.png';
import a3 from './image/img3.png';
import a4 from './image/img4.jpg';
import a5 from './image/img5.png';
import a6 from './image/img6.png';



function Homepage() {
  return (
    <div>
<Carousel>
      <CarouselItem>
        <img className="nature" alt="homeimages" src={'img1.png'}/>
      </CarouselItem>
      <CarouselItem>
      <img className="nature" alt="homeimages" src={a2}/>
      </CarouselItem>
      <CarouselItem>
        <img className="nature" alt="homeimages" src={a3}/>
      </CarouselItem>
      <CarouselItem>
        <img className="nature"  alt="homeimages" src={a4}/>
      </CarouselItem>
      <CarouselItem>
        <img className="nature" alt="homeimages"  src={a5}/>
      </CarouselItem>
      <CarouselItem>
        <img className="nature" alt="homeimages" src={a6}/>
      </CarouselItem>

    </Carousel>
    </div>)}

   export default Homepage
